B.zJ=new A.c0("Das folgende Applet stellt den Kurzkanaleffekt mit Hilfe des B\xe4nderdiagramms dar. Die am Transistor anliegenden Spannungen sind vorgegeben; die Kanall\xe4nge kann eingestellt werden.\n\nMan sieht:\n",B.KA,"Englisch",B.a2,null)
B.KD=A.a(s(["Je nach Typ (n oder p) sind freie Elektronen oder L\xf6cher in einem Halbleiter vorhanden.","Legt man eine Spannung U an die Struktur, so bewirkt dies ein elektrisches Feld E im Halbleiter.","Unter Einfluss des elektrisches Feldes E bewegen sich die freien Ladungstr\xe4ger in dem Halbleiter, was zu einem elektrischen Strom I f\xfchrt.","Je gr\xf6\xdfer die Spannung ist, desto so gr\xf6\xdfer ist das elektrische Feld und damit die Geschwindigkeit der Ladungstr\xe4ger, was eine Zunahme des Stromes bedeutet. Der Zusammenhang zwischen elektrischem Feld und der Ladungstr\xe4gergeschwindigkeit ist die so genannte Beweglichkeit."]),t.s)
B.zK=new A.c0("Dieses Applet verdeutlicht den Einfluss eines elektrischen Feldes auf freie Ladungstr\xe4ger in einem Halbleiter.\n\nMan sieht:\n",B.KD,"Englisch",B.a2,null)
B.IY=A.a(s(["Ist im Valenzband eine L\xfccke (auch Defektelektron oder Loch genannt) entstanden, so k\xf6nnen benachbarte Elektronen in diese L\xfccke springen (obere Grafik), was einem Ladungstransport und damit einem Stromfluss entspricht.","Die Bewegung der nachr\xfcckenden Elektronen (hier: Bewegung negativer Ladung von rechts nach links) hat den gleichen Effekt wie eine sich in die andere Richtung (also von links nach rechts) bewegende positive Ladung (untere Grafik).","Ein fehlendes Elektron, d.h. allgemein ein Zustand, der nicht von einem Elektron besetzt ist, kann daher als ein eigenes Teilchen mit positiver Ladung, ein so genanntes Loch, betrachtet werden.","Neben der Anzahl der freien Elektronen im Leitungsband ist daher auch die Anzahl der freien L\xf6cher im Valenzband wesentlich f\xfcr die elektrischen Eigenschaften des Halbleiters verantwortlich, da beide Ladungstr\xe4gerarten zum Stromtransport beitragen k\xf6nnen."]),t.s)
B.zL=new A.c0('Bricht durch Zufuhr von Energie eine Bindung im undotierten Halbleiter auf, d.h. gelangt im B\xe4nderdiagramm ein Elektron vom Valenzband in das Leitungsband, so kann es sich frei bewegen und zum Ladungstransport beitragen. Doch auch die entstandene "L\xfccke" (das Loch) kann zum Ladungstransport beitragen, indem in diese L\xfccke ein anderes Elektronen nachr\xfcckt, welches daraufhin an einer anderen Stelle ein Loch hinterl\xe4sst. Das Loch "wandert" also gleichsam durch den Halbleiter. Das folgende Applet zeigt die zwei m\xf6glichen Betrachtungsweisen des Ladungstransports im Valenzband. Die obere Abbildung zeigt die Bewegung der Elektronen (Elektronenkonzept), die untere stellt den Vorgang durch die Bewegung der "L\xfccke" dar (L\xf6cherkonzept).\n\nMan sieht:\n',B.IY,"Englisch",B.a2,null)
B.Jl=A.a(s(["Bei ausgeschaltetem Licht befinden sich in der Halbleiterprobe keine zus\xe4tzlichen Elektron-Loch Paare; die Tr\xe4gerdichten n, p entsprechen den Gleichgewichtsdichten n0, p0.","Nach dem Einschalten des Lichts erh\xf6ht sich durch die zugef\xfchrte Energie die Generationsrate, d.h. es werden zus\xe4tzliche Elektron-Loch Paare gebildet: Die Tr\xe4gerdichten n und p steigen um den jeweils gleichen Betrag an.","Da mit zunehmender Ladungstr\xe4gerdichte n, p auch die Rekombinationsrate R steigt (R ~ n*p), stellt sich nach einiger Zeit ein neuer Gleichgewichtszustand ein, in dem genauso viel Ladungstr\xe4gerpaare generiert werden wie durch Rekombination verschwinden.","Wird das Licht wieder ausgeschaltet, werden keine zus\xe4tzlichen Ladungstr\xe4ger mehr generiert und nach einiger Zeit wird der urspr\xfcngliche Gleichgewichtszustand (TGG) wieder erreicht.","Die Zeitkonstante, mit der der Ausgleichsvorgang erfolgt, ist die Lebensdauer der Minorit\xe4tstr\xe4ger."]),t.s)
B.zM=new A.c0("In einem Halbleiter werden bei Temperaturen T>0 st\xe4ndig Elektron-Loch Paare durch thermische Generation erzeugt; gleichzeitig rekombiniert die gleiche Anzahl von Elektron-Loch Paaren, so dass sich ein - temperaturabh\xe4ngiges - Gleichgewicht, das so genannte thermodynamische Gleichgewicht (TGG) einstellt. Durch Injektion zus\xe4tzlicher Ladungstr\xe4ger oder Lichteinstrahlung kann dieses Gleichgewicht jedoch gest\xf6rt werden.\n\nDieses Applet zeigt das Verhalten einer Halbleiterprobe bei einer St\xf6rung des TGGs durch Lichteinstrahlung und den anschlie\xdfenden Ausgleichsvorgang. Der Anschaulichkeit halber werden in dem Halbleiter nur die durch die Lichteinstrahlung zus\xe4tzlich generierten Ladungstr\xe4ger dargestellt.\n\nMan sieht:\n",B.Jl,"Englisch",B.a2,null)
B.Kt=A.a(s(["Frei bewegliche Teilchen f\xfchren bei Temperaturen T>0K thermische Bewegungen aus, deren Betrag und Richtung statistisch verteilt sind.","Betrachtet man zun\xe4chst nur die linke Kammer, so ist in dieser die Teilchenkonzentration \xfcberall konstant. Im Mittel heben sich demnach die thermischen Bewegungen der Teilchen gegenseitig auf.","Wird die Trennung zwischen den Kammern entfernt, so entsteht an dieser Stelle ein sehr gro\xdfer Konzentrationsgradient dn/dx. In diesem Bereich heben sich die thermischen Bewegungen nicht mehr gegenseitig auf und es kommt zu einem Zerflie\xdfen des Teilchenhaufens, so lange, bis die Teilchenkonzentration wieder \xfcberall konstant ist.","Dieser Diffusionsvorgang durch thermische Bewegung ist unabh\xe4ngig von der Ladung der Teilchen. Handelt es sich jedoch um freie Elektronen oder L\xf6cher, so f\xfchrt die Diffusionsbewegung zu einem Diffusionsstrom. Dieser ist proportional dem Gradienten der Ladungstr\xe4gerverteilung dn/dx und der Temperatur T."]),t.s)
B.zN=new A.c0("Dieses Applet veranschaulicht den Vorgang der Diffusion.\n\nMan sieht:\n",B.Kt,"Englisch",B.a2,null)
B.JA=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern des Bauelementes generiert, die zum Ladungstransport beitragen k\xf6nnen.","Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger, was wiederum eine Erh\xf6hung der Leitf\xe4higkeit bewirkt. Entsprechend sinkt die Leitf\xe4higkeit bei Verringerung der Bestrahlungsst\xe4rke.","Um die durch die Bestrahlung generierten Ladungstr\xe4ger im Innern des Bauelementes zu trennen und zu den Elektroden hin zu transportieren, ist ein elektrisches Feld E bzw. eine von au\xdfen angelegte Spannung U erforderlich.","Je h\xf6her diese Spannung U ist, desto gr\xf6\xdfer ist der Strom I durch den Fotowiderstand.","Der Strom I ist somit in guter N\xe4herung sowohl zu der Bestrahlungsst\xe4rke Ee als auch zu der angelegten Spannung U proportional, was zu der im Applet rechts gezeigten Widerstandsgeraden f\xfchrt, deren Steigung mit steigender Bestrahlungsst\xe4rke zunimmt.","Ohne Bestrahlung (Ee = 0) weist der Fotowiderstand eine von null verschiedene, geringe Leitf\xe4higkeit auf, d.h. bei einer angelegten Spannung flie\xdft ein geringer Dunkelstrom (der jedoch im linken Teil des Applets nicht animiert ist)."]),t.s)
B.zO=new A.c0("Dieses Applet veranschaulicht die Funktion eines Fotowiderstandes. Die linke Seite des Applets zeigt eine schematische Darstellung des Fotowiderstandes, wobei aus Gr\xfcnden der \xdcbersichtlichkeit nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert werden. Die rechte Seite des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\n\nMan sieht:\n",B.JA,"Englisch",B.a2,null)
B.HX=A.a(s(["Bei niedrigen Temperaturen (hier: 300K) ist das Atom in einem energetisch niedrigen Zustand. In dem dargestellten Atommodell befindet sich das Elektron auf der inneren Schale.","Durch Erh\xf6hen der Temperatur gelangt das Elektron auf eine weiter au\xdfen liegende Schale. Dies entspricht einem angeregten Energiezustand.","Tr\xe4gt man die m\xf6glichen Energiewerte W, die das Atom annehmen kann, in einem einfachen Diagramm auf, so ergeben sich mehrere diskrete Zust\xe4nde (Energielinien), deren Anzahl und Abst\xe4nde f\xfcr das Atom charakteristisch ist."]),t.s)
B.zP=new A.c0("Atome k\xf6nnen unterschiedliche Energiezust\xe4nde annehmen. Dieses Applet zeigt in einer stark vereinfachten Darstellung einen Atomkern (rot) mit einem Valenzelektron (blau), welches durch Zuf\xfchren von W\xe4rmeenergie angeregt wird.\n\nMan sieht:\n",B.HX,"Englisch",B.a2,null)
B.HY=A.a(s(["Bei einem einzigen Atom (n=1) erh\xe4lt man zwei m\xf6gliche Energiezust\xe4nde, von denen der untere besetzt ist.","Bei zwei Atomen (n=2) spalten sich die Energiezust\xe4nde wegen der Kopplung zwischen den beiden Atomen auf.","Erh\xf6ht man die Anzahl der Atome weiter, so spalten sich die Energieniveaus immer weiter auf, bis diese bei einer sehr gro\xdfen Anzahl von Atomen (hier n=16) so dicht beieinander liegen, dass man nicht mehr von Energielinien sondern von Energieb\xe4ndern spricht.","Da in diesem Beispiel eine sehr niedrige Umgebungstemperatur angenommen wurde, befinden sich alle Elektronen in dem jeweils niedrigsten Energiezustand, d.h. in dem unteren Energieband. Das obere Energieband ist unter diesen Bedingungen vollst\xe4ndig unbesetzt."]),t.s)
B.zQ=new A.c0("Dieses Applet illustriert den \xdcbergang von einem einzelnen Atom zu einem Kristall mit einer sehr gro\xdfen Zahl von regelm\xe4\xdfig angeordneten Atomen, wobei der Abstand der Atome untereinander so gering ist, dass die Atome miteinander in Wechselwirkung stehen. Die Umgebungstemperatur sei in dem Beispiel sehr niedrig, so dass jeweils die untersten Energiezust\xe4nde besetzt sind.\n\nMan sieht:\n",B.HY,"Englisch",B.a2,null)
B.JJ=A.a(s(["Der Bipolartransistor besteht aus drei unterschiedlich dotierten Gebieten (Emitter, Basis und Kollektor). Im Fall des npn-Transistors sind der Emitter (E) und der Kollektor (C) n-dotiert, die Basis (B) ist p-dotiert, so dass man zwei hintereinandergeschaltete pn-\xdcberg\xe4nge erh\xe4lt."]),t.s)
