B.K8=A.a(s(["Da allein die Null- und Polstellen der \xdcbertragungsfunktion die \xdcbertragungseigenschaften der Schaltung festlegen, gen\xfcgt es, deren Lage in der komplexen Ebene anzugeben, was durch Kreuze (x) f\xfcr Pole und Kreise (o) f\xfcr Nullstellen erfolgt. Die in diesem Beispiel gezeigte Schaltung weist also zwei Polstellen p1 und p2 und keine Nullstellen auf.","Durch \xc4nderung des Schaltungsparameters v \xe4ndert sich unmittelbar die \xdcbertragungsfunktion und damit auch die Lage der Polstellen in der komplexen Ebene wie im Bild oben links dargestellt.","Die Polstellenverteilung hat wiederum Einfluss auf den Frequenzgang |A(jw)| sowie den Phasengang phase(A(jw)) der Schaltung (Bild rechts oben bzw. unten).","Ebenso besteht ein wichtiger Zusammenhang zwischen der Lage der Polstellen und dem dynamischen Verhalten der Schaltung. Da jeder Pol s' der \xdcbertragungsfunktion A(s) einen Term der Form 1-exp(s' t) in der Sprungantwort liefert (Laplace-Transformation), bedeutet ein reeller Pol in der linken Halbebene der komplexen Frequenzebene (v<1) einen aperiodischen Anstieg der Sprungantwort auf deren Endwert (hier: v). Ein konjugiert komplexes Polpaar in der linken Halbebene (1<v<3) verursacht wegen der komplexen Exponentialfunktion einen periodischen Einschwingvorgang und f\xfcr ein rein komplexes Polpaar (v=3) ergibt sich schlie\xdflich eine unged\xe4mpfte Sinusschwingung.","Je n\xe4her die Pole der \xdcbertragungsfunktion in Richtung der imagin\xe4ren Achse wandern, um so eher neigt die Schaltung zum Schwingen. Dies zeigt sich au\xdfer in der Sprungantwort auch in dem Frequenzgang |A(jw)|, der bei der Schwingfrequenz eine ausgepr\xe4gte \xdcberh\xf6hung zeigt. Besonders kritisch ist Situation bei gegengekoppelten Verst\xe4rkerschaltungen, bei denen man der Stabilit\xe4t besonderes Augenmerk widmen muss."]),t.s)
B.zT=new A.c0("Dieses Applet zeigt f\xfcr eine konkrete Schaltung mit der \xdcbertragungsfunktion A(jw)=ua/ue beispielhaft den Einfluss eines der Schaltungsparameter auf die Lage der Polstellen und damit auf den Frequenzgang. Ebenso ist der Einfluss der Lage der Pole auf den Phasengang und auf die Sprungantwort dargestellt.\n\nMan sieht:\n",B.K8,"Englisch",B.a2,null)
B.K5=A.a(s(["Jedes der Siliziumatome hat vier Valenzen, die r\xe4umlich ausgerichtet sind, so dass sich benachbarte Atome bevorzugt in diesen Richtungen anlagern. Dadurch entsteht eine regelm\xe4\xdfige Struktur, das so genannte Kristallgitter."]),t.s)
B.zU=new A.c0("Das folgende Applet zeigt die dreidimensionale Struktur eines Siliziumkristalls, bestehend aus mehreren Siliziumatomen. Durch Ziehen mit der Maus kann der Kristall r\xe4umlich gedreht werden.\n\nMan sieht:\n",B.K5,"Englisch",B.a2,null)
B.KM=A.a(s(["Da im thermodynamischen Gleichgewicht die Fermienergie Wf (hier nicht dargestellt) im Bauelement \xfcberall auf dem gleichen Niveau liegt, ist die relative Lage der Valenz- und Leitungsbandkanten in den einzelnen Gebieten von den dortigen Dotierungen abh\xe4ngig (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm). In den n-dotierten Source- und Draingebieten liegen die Bandkanten Wc und Wv demnach unterhalb denen im p-dotierten Bulk und es ergeben sich die im Diagramm dargestellten Potenzialverl\xe4ufe.","Damit Elektronen von der Source zur Drain wandern k\xf6nnen, m\xfcssen diese erst die unterhalb des Gates liegende Potenzialbarriere \xfcberwinden. Die H\xf6he der Barriere h\xe4ngt dabei insbesondere von den am Transistor anliegenden Spannungen ab:",'Durch Anlegen einer positiven Gatespannung (UGS>0) gegen\xfcber dem Bezugspotenzial (Source) verschiebt sich das Ferminiveau an der Gate-Elektrode nach unten und die Bandkanten Wc und Wv im Bulk unmittelbar unterhalb des Gate "verbiegen" sich (vgl.: B\xe4nderdiagramm einer MOS-Struktur). Dadurch verringert sich die Potenzialbarriere.',"Durch Anlegen einer negativen Bulkspannung (USB>0) gegen\xfcber dem Bezugspotenzial (Source) verschieben sich das dortige Ferminiveau und damit die Bandkanten Wc und Wv im Bereich des Bulk nach oben und die Potentialbarriere erh\xf6ht sich.","Ob ein Strom durch den Transistor flie\xdfen kann oder nicht, h\xe4ngt somit von der Lage der Bandkanten unmittelbar unterhalb des Gates (im Bereich des Kanals) ab. In den nachfolgenden Applets ist daher lediglich der Verlauf der Bandkanten entlang der y-Achse bei x=0 dargestellt."]),t.s)
B.zV=new A.c0("Das Applet zeigt den Verlauf des B\xe4nderdiagramms eines MOSFET \xfcber dem Querschnitt des Bauelementes. Es wird der Einfluss von Gate- und Substratspannung auf den Verlauf der Bandkanten Wc und Wv schematisch dargestellt. In dem Applet liegt der Source-Anschluss auf 0V (Bezugspotenzial).\n\nMan sieht:\n",B.KM,"Englisch",B.a2,null)
B.Jj=A.a(s(["Abh\xe4ngig von der Lage des Ferminiveaus handelt es sich um einen p- oder n-Typ Halbleiter mit entsprechender Konzentration der Ladungstr\xe4gerdichten (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus).","Bei einer Spannung von U=0V liegt das Ferminiveau \xfcberall auf gleicher H\xf6he, der Halbleiter ist im thermodynamischen Gleichgewicht und es flie\xdft kein Strom durch den Halbleiter.","Das Anlegen einer elektrischen Spannung an den Halbleiter bewirkt eine Verschiebung der Bandkanten gem\xe4\xdf U=-W/q, so dass das Ferminiveau innerhalb des Halbleiters nicht mehr auf energetisch gleicher H\xf6he liegt, was einer St\xf6rung des thermodynamischen Gleichgewichts entspricht.",'Elektronen und L\xf6cher bewegen sich aufgrund ihrer Ladung und der Richtung des elektrischen Feldes zu den entsprechenden Polen der Spannungsquelle. In der B\xe4nderdiagrammdarstellung haben Elektronen stets das Bestreben, "nach unten" zu flie\xdfen, da dies einer Abnahme ihrer Energie entspricht; L\xf6cher streben entsprechend "nach oben". Bei geneigten Bandkanten stellt sich somit ein Ladungstr\xe4gertransport und damit ein Stromfluss I ein.',"Abh\xe4ngig von der Art und St\xe4rke der Dotierung (d.h. der Lage des Ferminiveaus relativ zu Wi) wird der Strom eher von Elektronen (n-Typ Halbleiter) oder von L\xf6chern (p-Typ Halbleiter) getragen."]),t.s)
B.zW=new A.c0("Das folgende Applet zeigt den Vorgang des Ladungstr\xe4gertransportes in einem Halbleiter mit Hilfe der B\xe4nderdiagrammdarstellung, abh\xe4ngig von der angelegten Spannung und der Lage des Ferminiveaus.\n\nMan sieht:\n",B.Jj,"Englisch",B.a2,null)
B.KN=A.a(s(["Das Anlegen einer Drain-Source Spannung UDS f\xfchrt nur dann zu einem Strom IDS durch den Transistor, wenn die Gate-Source Spannung UGS gr\xf6\xdfer ist als die Einsatzspannung Uth,n, da sich erst dann ein leitender Kanal unter dem Gate bildet.","\xdcberschreitet die Gate-Source Spannung UGS die Einsatzspannung Uth,n, so bildet sich ein leitender Kanal unterhalb des Gates und es kann ein Strom flie\xdfen, wenn eine Spannung UDS angelegt wird.","Der Strom IDS steigt - bei konstantem UGS - zun\xe4chst mit gr\xf6\xdfer werdender Spannung UDS stark an. Diesen Bereich bezeichnet man als Widerstandsbereich.","Mit gr\xf6\xdfer werdender Spannung UDS erreicht der Strom jedoch einen S\xe4ttigungswert und steigt dann nur noch geringf\xfcgig an. Dieser Bereich wird als S\xe4ttigungsbereich bezeichnet."]),t.s)
