B.Jm=A.a(s(["Bei negativen Spannungen zwischen Gate und Halbleitermaterial (UGB<0V) werden freie Ladungstr\xe4ger (L\xf6cher) aus dem p-dotierten Material von der negativen Elektrode angezogen, so dass eine Schicht positiver Ladung unterhalb des Gates entsteht. Auf dem Gate bildet sich eine entsprechende Gegenladung. Den sich einstellenden Zustand nennt man Akkumulation.","Bei einer positiven Spannung am Gate (UGB>0V) wandern die freien L\xf6cher von der positiven Elektrode weg. In dem ausger\xe4umten Gebiet verbleiben nur die (nicht gezeichneten) negativ ionisierten Dotierungsatome und es entsteht eine Raumladungszone. Diesen Zustand bezeichnet man als Verarmung.","Wird die Spannung am Gate weiter erh\xf6ht, so dass schlie\xdflich die Einsatzspannung \xfcberschritten wird (UGB>Uth,n), werden Elektronen-Loch Paare generiert, wobei die positiven L\xf6cher in das Substrat wandern, die negativen Elektronen jedoch von der positiven Elektrode angezogen werden, wo sie eine leitende Inversionsschicht bilden. Bei einem n-Kanal Feldeffekttransistor mit n-dotierten Source- und Drain-Anschl\xfcssen stellt dieser Elektronen-Kanal eine leitende Verbindung zwischen Source und Drain dar: Ein Feldeffekttransistor leitet also, wenn die Gate-Source Spannung die Einsatzspannung \xfcberschreitet."]),t.s)
B.zZ=new A.c0("Das folgende Applet zeigt das Verhalten einer MOS-Struktur beim Anlegen unterschiedlicher Spannungen. Eine MOS-Struktur besteht aus einem Halbleiter (hier p-Typ) mit einer isolierenden Oxidschicht, auf der eine Metallelektrode aufgebracht ist. Zwischen der Metallelektrode (G) und dem Halbleiter (B) kann eine Spannung angelegt werden. Nach Vorgabe der Spannung werden die freien Ladungstr\xe4ger innerhalb der Struktur und die Ladungsdichten dargestellt.\n\nMan sieht:\n",B.Jm,"Englisch",B.a2,null)
B.KI=A.a(s(["Ausgangspunkt der \xdcberlegungen ist das vereinfachte Ersatzschaltbild des zu kompensierenden Verst\xe4rkers mit den parasit\xe4ren Kapazit\xe4ten, welche die Polstellen der \xdcbertragungsfunktion a(jw) und damit den Frequenz- und Phasengang bestimmen. F\xfcr den zu untersuchenden kritischen Fall gr\xf6\xdftm\xf6glicher R\xfcckkopplung, d.h. k=1 bzw. 1/k=0dB, entspricht die Kurve |a(jw)| gleichzeitig der f\xfcr die Stabilit\xe4t wichtigen Schleifenverst\xe4rkung |a*k|. Die Frequenz wd, bei der der Betrag der Schleifenverst\xe4rkung gleich 1 ist, ergibt sich demnach aus dem Schnittpunkt der Kurve |a(jw)| mit der Frequenzachse.","F\xfcr den nicht kompensierten Verst\xe4rker sieht man, dass bei dieser Frequenz die Phase 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.","Eine M\xf6glichkeit, den Verst\xe4rker zu stabilisieren, ist nun, die Kapazit\xe4t C1 zu vergr\xf6\xdfern. Dadurch verschiebt sich der Pol w1 der \xdcbertragungsfunktion, womit eine \xc4nderung des Frequenz- und des Phasengangs einhergeht. Insbesondere erreicht man jedoch, dass durch den jetzt fr\xfcher einsetzenden Verst\xe4rkungsabfall die Frequenz wd zu niedrigeren Werten hin verschoben wird, bei denen die Phasendrehung noch keine 180 Grad betr\xe4gt. Der Verst\xe4rker bleibt somit stabil.","Nachteilig ist jedoch, dass zur Kompensation sehr gro\xdfe Kapazit\xe4tswerte im nF-Bereich n\xf6tig sind, was f\xfcr integrierte Operationsverst\xe4rker nicht akzeptabel ist. Eine bessere Methode zur Kompensation ist daher die so genannte Miller-Kompensation."]),t.s)
B.A_=new A.Gl(null)
B.KG=A.a(s(["Bei dieser Art der Kompensation wird die Kompensationskapazit\xe4t Ck nicht parallel zu C1, sondern zwischen die beiden Verst\xe4rkerstufen eingef\xfcgt.","F\xfcr den nicht kompensierten Verst\xe4rker, d.h. Ck=0, sieht man, dass f\xfcr sehr hohe Frequenzen die Phasenverschiebung 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.",'Durch Vergr\xf6\xdferung von Ck werden nun, da die beiden Verst\xe4rkerstufen nicht mehr unabh\xe4ngig voneinander sind, beide Pole beeinflusst. Insbesondere wandert der Pol p1 zu niedrigeren Frequenzen, wie es auch bereits bei der Kompensation durch Polverschiebung der Fall war. Zus\xe4tzlich verschiebt sich aber auch der Pol p2 zu h\xf6heren Frequenzen, so dass beide Pole weiter auseinanderstreben ("pole splitting") und damit der kritische Wert der Phasendrehung von 180 Grad erst bei h\xf6heren Frequenzen erreicht wird.',"Wichtigster Vorteil ist jedoch, dass bereits sehr kleine Werte von Ck ausreichen, um den Pol p1 zu verschieben. Der Grund daf\xfcr liegt darin, dass Ck zwischen beiden Verst\xe4rkerstufen liegt, und damit bereits kleine Spannungs\xe4nderungen an der Eingangsstufe gro\xdfe Spannungs\xe4nderungen \xfcber der Kapazit\xe4t bewirken. Diese wirkt dadurch wie eine um den Faktor der Spannungsverst\xe4rkung vergr\xf6\xdferte Kapazit\xe4t, die parallel zu C1 liegt (Miller-Effekt)."]),t.s)
B.A0=new A.Gm(null)
B.KF=A.a(s(["Ersetzt man die imagin\xe4re Variable jw der \xdcbertragungsfunktion A(jw) formal durch die komplexe Gr\xf6\xdfe s=r+jw, so erh\xe4lt man eine Funktion A(s), die nun z.B. dem Betrag nach in der komplexen r-w Ebene dargestellt werden kann (unteres Bild). Man spricht in diesem Fall von analytischer Fortsetzbarkeit, da die urspr\xfcngliche Funktion mit imagin\xe4rem Argument ins Komplexe fortgesetzt wird. Dies ist auf Grund der Holomorphie rationaler Funktionen m\xf6glich.","Der Verlauf der Funktion |A(s)| in der komplexen Ebene ist durch die Lage der Null- und Polstellen eindeutig definiert. Insbesondere ist durch die Lage der Null- und Polstellen auch der Verlauf von |A(s)| f\xfcr r=0, d.h. entlang der Frequenzachse, festgelegt. Dies entspricht aber gerade dem Frequenzgang |A(jw)|, der f\xfcr positive Frequenzen, d.h. jw>0, im oberen Bild zur Verdeutlichung nochmals im logarithmischen Ma\xdfstab dargestellt ist.","Der Einfluss der Lage der Pole auf den Frequenzgang |A(jw)| wird deutlich, wenn in dem Beispiel der Parameter a und damit die Lage der Pole ge\xe4ndert wird. Verschieben sich diese z.B. f\xfcr kleiner werdendes a in Richtung der Frequenzachse (jw), so tritt im Frequenzgang eine deutliche \xdcberh\xf6hung auf. F\xfcr den Schaltungsentwickler interessant ist nun die Frage, welchen Einfluss Schaltungsparameter auf die Lage der Pole und damit auf den Frequenzgang der Schaltung haben."]),t.s)
B.A1=new A.Gn(null)
B.KJ=A.a(s(["F\xfcr eine gegebene Spannung UBE liefert der Schnittpunkt der jeweiligen Transistorausgangskennlinie mit der Lastgeraden den Wert des Stromes IC sowie der Ausgangsspannung UCE.","Soll eine sinusf\xf6rmige Basis-Emitter-Spannung (AC on) verst\xe4rkt werden, so ergibt sich die beste Verst\xe4rkerwirkung, wenn das Signal um eine Spannung UBE0 herum ge\xe4ndert wird, die in etwa in der Mitte des aussteuerbaren Bereiches, d.h. UBE0=0.72V, liegt.","Bei gr\xf6\xdferen oder kleineren Werten von UBE0 arbeitet der Transistor entweder im S\xe4ttigungs- oder im Sperrbetrieb, so dass die Verst\xe4rkung deutlich abnimmt."]),t.s)
B.A2=new A.c0(u.f,B.KJ,"Englisch",B.a2,null)
B.Ik=A.a(s(["Wie bei der einfachen Bipolar-Verst\xe4rkerschaltung mit ohmscher Last kann die \xdcbertragungskennlinie auch f\xfcr aktive Lastelemente grafisch konstruiert werden, indem das Ausgangskennlinienfeld IDS=IDS(UDS,UGS) des Transistors und die entsprechende Kennlinie IDS(UDS) des Lastelementes in ein Diagramm eingetragen werden. Die Schnittpunkte der Kurven ergeben dann f\xfcr gegebene Werte der Eingangsspannung UGS die dazugeh\xf6rigen Werte der Ausgangsspannung UDS.","Abh\xe4ngig von dem Lastelement (Widerstand, Anreicherungs-, oder Verarmungstransistor) ergeben sich unterschiedliche \xdcbertragungskennlinien des Inverters. Die Kleinsignalspannungsverst\xe4rkung, die der Steigung dUDS/dUGS der \xdcbertragungskennlinie entspricht, h\xe4ngt stark von der Form der Lastkennlinie ab. Sie wird um so gr\xf6\xdfer, je flacher die Lastkennlinie verl\xe4uft, d.h. je gr\xf6\xdfer der differentielle Widerstand r=dUDS/dIDS des Lastelementes ist. In analogen Verst\xe4rkerschaltungen werden daher statt Widerst\xe4nden als Lastelement oft aktive Lasten eingesetzt."]),t.s)
B.A3=new A.Go(null)
B.If=A.a(s(["F\xfcr sehr gro\xdfe Basisweiten XB entspricht die Ladungstr\xe4gerverteilung der Basis-Emitter-Diode einem in Durchlassrichtung gepolten pn-\xdcbergang. Der Wert von n' an der Stelle x=0 wird dabei von der Spannung UBE \xfcber der Basis-Emitter-Diode bestimmt. Mit zunehmendem Abstand von der Raumladungszone nehmen die Minorit\xe4tstr\xe4gerdichten f\xfcr gro\xdfe Basisweiten dann exponentiell ab.","Der Basis-Kollektor-\xdcbergang des Transistors ist im Normalbetrieb in Sperrrichtung gepolt, so dass die \xdcberschussladungstr\xe4gerdichten n' und p' an den R\xe4ndern der Basis-Kollektor-Raumladungszone praktisch null sind.","Bringt man die beiden pn-\xdcberg\xe4nge sehr dicht zusammen, d.h. ist die Basisweite XB sehr klein, wird aus dem exponentiellen Verlauf der Ladungstr\xe4ger n' in der Basis (blaue Kurve) n\xe4herungsweise eine Gerade. Diese hat eine um so gr\xf6\xdfere Steigung, je kleiner die Basisweite XB ist."]),t.s)
B.A4=new A.c0("Dieses Applet veranschaulicht die Ladungstr\xe4gerverteilung eines Bipolartransistors im Normalbetrieb f\xfcr unterschiedliche Basisweiten.\n\nMan sieht:\n",B.If,"Englisch",B.a2,null)
B.J0=A.a(s(["Fall 1: Schottky-Kontakt mit n-typ Halbleiter\nIst die angelegte Spannung U positiv, verschiebt sich das Ferminiveau Wfm im Metall gem\xe4\xdf W = -q\xb7U nach unten, was zu einer entsprechenden Verbiegung der B\xe4nder f\xfchrt. Dadurch wird die Potentialbarriere kleiner, so dass Elektronen (blau dargestellt) vom Halbleiter in das Metall gelangen k\xf6nnen. Wird die Spannung weiter erh\xf6ht, sinkt die Barriere immer mehr ab und der Elektronenstrom kann entsprechend zunehmen.\nIst die Spannung U hingegen negativ, so verschiebt sich das Ferminiveau Wfm im Metall nach oben und die Potentialbarriere f\xfcr Elektronen erh\xf6ht sich, so dass praktisch keine Elektronen vom Halbleiter in das Metall gelangen k\xf6nnen, d.h. es kann kein Strom flie\xdfen. Tr\xe4gt man das beschriebene Strom-Spannungsverhalten auf, zeigt der untersuchte \xdcbergang im Wesentlichen ein dioden\xe4hnliches Verhalten.","Fall 2: Ohmscher Kontakt mit n-typ Halbleiter\nEs ist keine Potentialbarriere vorhanden, die einen Elektronenstrom verhindern k\xf6nnte. Somit k\xf6nnen bei positiver Spannung U Elektronen praktisch ungehindert vom Halbleiter ins Metall und bei negativer Spannung vom Metall in den Halbleiter gelangen. Der Strom wird dabei nur vom ohmschen Widerstand der neutralen Bahngebiete begrenzt."]),t.s)
B.A5=new A.Gp(null)
B.Jg=A.a(s(["Eine Polstelle bewirkt einen Abfall des Betrages der \xdcbertragungsfunktion ab einer Grenzfrequenz, die von der Lage des Pols abh\xe4ngt. Je n\xe4her der Pol an der komplexen Achse liegt, um sehr niedriger ist die entsprechende Grenzfrequenz. Ebenfalls erfolgt eine Phasendrehung bei der Grenzfrequenz um -90 Grad.","Eine Nullstelle bewirkt einen Anstieg des Betrages der \xdcbertragungsfunktion sowie eine Phasendrehung um +90 Grad bei der zu der Nullstelle geh\xf6renden Grenzfrequenz.","Existieren mehrere Pol- oder Nullstellen, so \xfcberlagern sich deren Wirkungen. Insbesondere kompensieren sich Null- und Polstellen gegenseitig, wenn sie an der gleichen Stelle in der komplexen Ebene liegen.","Konjugiert komplexe Pole f\xfchren wegen des imagin\xe4ren Anteils zu Sinus- und Cosinus-Anteilen in der Sprungantwort. Der Realteil f\xfchrt zu einer exponentiellen D\xe4mpfung, wenn die Polstelle in der linken Halbebene liegt und zu einer ansteigenden Schwingung, wenn der Realteil des Poles positiv ist."]),t.s)
B.A6=new A.c0("Dieses Applet zeigt den Einfluss der Lage von Pol- (x) und Nullstellen (o) einer komplexen \xdcbertragungsfunktion auf den Amplituden- und Phasengang sowie die Sprungantwort. Im unteren, linken Fenster des Applets lassen sich Pol- und Nullstellen hinzuf\xfcgen, verschieben und l\xf6schen.\n        \nMan sieht: \n        ",B.Jg,"Englisch",B.a2,null)
B.Iz=A.a(s(["Bei USB=0 flie\xdft ein Strom zwischen Source (S) und Drain (D), da durch die angelegte Gate-Spannung die Potenzialbarriere zwischen Source und Bulk \xfcberwunden werden kann und somit Elektronen zur Drain-Elektrode gelangen k\xf6nnen.","Legt man eine gegen\xfcber der Source-Elektrode negative Spannung an das Bulk, d.h. USB>0, so verschieben sich die Bandkanten Wc und Wv im Bereich des Bulks nach oben. Damit erh\xf6ht sich die von den Elektronen zu \xfcberwindende Barriere, was sich in einer h\xf6heren Einsatzspannung Uth ausdr\xfcckt. F\xfcr USB=3V ist diese Barriere so gro\xdf, dass sie nicht mehr von den Elektronen \xfcberwunden werden kann. Die Einsatzspannung ist in diesem Fall gr\xf6\xdfer als die Spannung UGS und der Transistor sperrt."]),t.s)
B.A7=new A.c0("Das folgende Applet veranschaulicht den Substratsteuereffekt mit Hilfe des B\xe4nderdiagramms.\n\nMan sieht:\n",B.Iz,"Englisch",B.a2,null)
B.Kj=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.","Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.s)
B.A9=new A.c0("Dieses Applet veranschaulicht die Arbeitspunkteinstellung bei einem Verst\xe4rker mit Stromspiegel.\n\nMan sieht:\n",B.Kj,"Englisch",B.a2,null)
B.Kv=A.a(s(["F\xfcr T=0 nehmen die Elektronen ihren jeweils niedrigstm\xf6glichen Energiezustand an. Da nach dem Pauli-Prinzip ein Zustand jedoch nur mit maximal zwei Elektronen besetzt werden kann, sind auch von Null verschiedene Zust\xe4nde mit Elektronen besetzt. Die Energie, bis zu der bei T=0 alle Zust\xe4nde besetzt sind, bezeichnet man als das Ferminiveau Wf.","Die Besetzungswahrscheinlichkeit F(W) ist bei T=0 daher F(W)=1 f\xfcr alle Energieniveaus unterhalb des Ferminiveaus und F(W)=0 f\xfcr alle Energieniveaus oberhalb des Ferminiveaus.","Eine Erh\xf6hung der Temperatur T f\xfchrt zu einer Zunahme der Gesamtenergie in dem System. Dies \xe4u\xdfert sich darin, dass einzelne Elektronen auch h\xf6here Energiezust\xe4nde annehmen k\xf6nnen. Die Besetzungswahrscheinlichkeit F(W) h\xf6herer Zust\xe4nde nimmt daher zu und die niedriger Zust\xe4nde entsprechend ab.","Je h\xf6her die Temperatur ist, um so h\xf6her ist die Gesamtenergie des Systems. Die Wahrscheinlichkeit, dass ein energetisch hochliegender Zustand besetzt ist, steigt demnach mit zunehmender Temperatur immer weiter an. Gleichzeitig nimmt die Wahrscheinlichkeit, dass energetisch tiefliegende Zust\xe4nde besetzt sind, ab."]),t.s)
B.Aa=new A.c0("Dieses Applet veranschaulicht die Bedeutung der Fermiverteilung F(W) und des Ferminiveaus anhand eines Systems mit diskreten Energiezust\xe4nden.\n\nMan sieht:\n",B.Kv,"Englisch",B.a2,null)
B.K4=A.a(s(["Bei sehr niedrigen Temperaturen sind alle Bindungen im Halbleiterkristall intakt. Es sind keine freien Elektronen vorhanden, die zum Stromtransport beitragen k\xf6nnen. In der B\xe4nderdiagrammdarstellung bedeutet dies, dass sich alle Elektronen im so genannten Valenzband befinden; das obere Energieband (Leitungsband) ist unbesetzt.","Wird die zum L\xf6sen einer Bindung n\xf6tige Energie (z.B. durch Erh\xf6hung der Temperatur) \xfcberschritten, entstehen freie Elektronen. Diese freien Elektronen befinden sich in der B\xe4nderdiagrammdarstellung im so genannten Leitungsband. Der Abstand von Leitungsband zu Valenzband, der Bandabstand Wg, entspricht dabei der Energie, die zugef\xfchrt werden muss, um eine Bindung zu l\xf6sen.","An den Stellen, wo vorher die jetzt freien Elektronen sa\xdfen, bleibt jeweils eine L\xfccke (ein so genanntes Loch) zur\xfcck. Diesem Loch kann - wegen der fehlenden negativen Ladung des Elektrons - eine positive Ladung zugeordnet werden. Da in diese L\xfccke wiederum andere Elektronen springen k\xf6nnen, tragen auch L\xf6cher zum Ladungstransport bei.","Durch das L\xf6sen von Bindungen zwischen Si-Atomen werden L\xf6cher und Elektronen paarweise generiert, so dass ihre Anzahl stets gleich gro\xdf ist.","Die Zahl der freien Ladungstr\xe4ger (Elektronen und L\xf6cher) in einem undotierten Halbleiter ist bei moderaten Temperaturen \xe4u\xdferst gering. Erst bei sehr hohen Temperaturen steigt die Anzahl der freien Ladungstr\xe4ger deutlich an. Durch Dotieren, d.h. den Einbau von Fremdatomen in den Halbleiter, kann jedoch die Zahl der freien L\xf6cher oder Elektronen gezielt ver\xe4ndert und bereits bei Raumtemperatur deutlich erh\xf6ht werden."]),t.s)
B.Ab=new A.c0("Ein undotierter Silizium-Halbleiter besteht ausschlie\xdflich aus vierwertigen Siliziumatomen (Si), die in einer regelm\xe4\xdfigen Kristallstruktur angeordnet sind. Dabei gehen die vier Valenzelektronen eines jeden Siliziumatoms so genannte kovalente Bindungen mit den Elektronen der benachbarten Si-Atome ein. Das Applet zeigt das Verhalten eines undotierten Halbleiters bei \xc4nderung der Temperatur. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im so genannten B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.K4,"Englisch",B.a2,null)
B.IZ=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern der Fotodiode generiert. Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger. Umgekehrt f\xfchrt eine Verringerung der Bestrahlungsst\xe4rke zu einer Verringerung der Generationsrate.","Die durch die Bestrahlung generierten Ladungstr\xe4ger werden durch das eingebaute elektrische Feld E der Raumladungszone sofort getrennt und zu den neutralen Bahngebieten hin abtransportiert, ohne dass dazu eine externe Spannung notwendig ist. Der Fotostrom steht daher direkt an den Elektroden der Fotodiode zur Verf\xfcgung. Der Fotostrom ist proportional zu der Bestrahlungsst\xe4rke Ee und in erster N\xe4herung unabh\xe4ngig von der angelegten Spannung U (der Grund hierf\xfcr ist, dass das eingebaute elektrische Feld E der Raumladungszone bereits gro\xdf genug ist, um die Ladungstr\xe4ger auf ihre S\xe4ttigungsgeschwindigkeit zu beschleunigen. Eine weitere Erh\xf6hung des elektrischen Feldes durch \xc4nderung der Spannung U f\xfchrt dann zu keiner weiteren Erh\xf6hung der Geschwindigkeit der Ladungstr\xe4ger - und damit zu keinem Anstieg des Stromes)."]),t.s)
B.Ac=new A.c0("Dieses Applet veranschaulicht die Funktion einer Fotodiode. Die in der linken Bildh\xe4lfte des Applets schematisch dargestellte Fotodiode besitzt eine pin-Struktur, d.h. zwischen dem p- und dem n-Gebiet liegt ein undotiertes (intrinsisches) i-Gebiet (grau dargestellt). Das p- und das n-Gebiet bewirken eine \xfcber das gesamte i-Gebiet ausgedehnte Raumladungszone mit einer hohen elektrischen Feldst\xe4rke E. Aus Gr\xfcnden der \xdcbersichtlichkeit werden nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert. Die rechte Bildh\xe4lfte des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Hellgrau schattiert ist der dritte Quadrant der Kennlinie (U<0 und I<0); in diesem Quadranten arbeitet die Fotodiode im Diodenbetrieb. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\n\nMan sieht:\n",B.IZ,"Englisch",B.a2,null)
B.J1=A.a(s(["Liegt keine \xe4u\xdfere Spannung \xfcber der Struktur (U=0V), ist der pn-\xdcbergang im thermodynamischen Gleichgewicht (TGG). In der gezeigten B\xe4nderdiagrammdarstellung liegt das Ferminiveau Wf im TGG \xfcberall auf gleicher H\xf6he. In diesem Fall liegen auch die Pegel der Elektronen im p- und im n-Gebiet auf gleicher H\xf6he, so dass keine Netto-Ausgleichsbewegung, d.h. Bewegung von Elektronen von einem Gebiet in das andere, erfolgt. Entsprechendes gilt f\xfcr die L\xf6cher, deren Pegel ebenfalls auf gleichem Niveau liegen.","Durch das Anlegen einer \xe4u\xdferen elektrischen Spannung U>0V an die Struktur verschieben sich die Bandkanten gem\xe4\xdf U=-W/q, wobei in der Darstellung der Anschaulichkeit halber der ohmsche Spannungsabfall im Halbleitermaterial (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm) vernachl\xe4ssigt ist. Der Pegel der Elektronen im n-Gebiet liegt in diesem Fall \xfcber dem der Elektronen in p-Gebiet, so dass Elektronen durch die Raumladungszone in das p-Gebiet wandern. Diese \xfcbersch\xfcssigen Elektronen f\xfchren zu einer lokalen St\xf6rung des TGG, und damit einer Zunahme der Rekombination (G<R) der \xfcbersch\xfcssigen Elektronen mit L\xf6chern, die st\xe4ndig aus dem p-Gebiet nachgeliefert werden, was einem Stromfluss entspricht. Entsprechende \xdcberlegungen gelten f\xfcr die L\xf6cher, deren Pegel im p-Gebiet unter dem im n-Gebiet liegt.","Bei einer Spannung U<0V verschieben sich die B\xe4nder in umgekehrte Richtung, so dass nun Minorit\xe4tstr\xe4ger \xfcber die Raumladungszone in das benachbarte Gebiet gelangen k\xf6nnen. Wegen der sehr geringen Tr\xe4gerdichte der Minorit\xe4tstr\xe4ger wandern jedoch nur sehr wenige Ladungstr\xe4ger durch die Raumladungszone, was einem sehr kleinen Strom entspricht, der auch mit zunehmender Sperrspannung nicht wesentlich ansteigt."]),t.s)
B.Ad=new A.c0("Dieses Applet zeigt f\xfcr einen pn-\xdcbergang die Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.J1,"Englisch",B.a2,null)
