B.Ae=new A.c0("Dieses Applet zeigt den prinzipiellen Ablauf eines NMOS-Prozesses am Beispiel der Herstellung eines n-Kanal Feldeffekttransistors. Der Anschaulichkeit halber sind nicht alle Prozessschritte im Einzelnen gezeigt und die Darstellungen sind zum Teil grob vereinfacht.\n",B.cv,"Englisch",B.cv,null)
B.Ag=new A.c0("Dieses Applet zeigt den stark vereinfachten Ablauf eines CMOS-Prozesses zur Herstellung integrierter Schaltungen. Im Gegensatz zum NMOS Prozess erlaubt der CMOS-Prozess die gleichzeitige Herstellung von n- und p-Kanal Feldeffekttransistoren auf einem Chip.\n",B.cv,"Englisch",B.a2,null)
B.Kn=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.s)
B.Ah=new A.c0("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Kn,"Englisch",B.a2,null)
B.Km=A.a(s(["Durch die Injektion zus\xe4tzlicher Ladungstr\xe4ger am linken Rand der Probe entsteht ein Konzentrationsgef\xe4lle, aufgrund dessen eine Diffusionsbewegung der Ladungstr\xe4ger von links nach rechts einsetzt.","Durch die Erh\xf6hung der Ladungstr\xe4gerdichten steigt die Rekombinationsrate R (R ~ n*p), so dass \xfcbersch\xfcssige Ladungstr\xe4ger paarweise rekombinieren. Die Tr\xe4gerdichten nehmen mit zunehmender Entfernung von der Injektionsstelle also wieder ab, bis sie schlie\xdflich sehr weit rechts von der Injektionsstelle wieder die Gleichgewichtswerte (n=n0 bzw. p=p0) erreicht haben.","Das gleiche Ergebnis h\xe4tte man erhalten, wenn man nur Minorit\xe4tstr\xe4ger (hier: L\xf6cher) injiziert h\xe4tte. Wegen des sich dann ergebenden Ladungsungleichgewichtes und dem dadurch hervorgerufenen elektrischen Feld h\xe4tte sich \"sofort\" (genauer: innerhalb der so genannten \"dielektrischen Relaxationszeit\") eine gleiche Anzahl zus\xe4tzlicher Elektronen aus dem n-Halbleiter angefunden, so dass gilt n'=p'. Die Minorit\xe4tstr\xe4ger bestimmen in diesem Experiment also im Wesentlichen das Verhalten des Halbleiters, insbesondere wird der abnehmende Verlauf der \xdcberschussladungstr\xe4gerdichten n' bzw p' allein durch die Minorit\xe4tstr\xe4gerlebensdauer bestimmt.","Tr\xe4gt man die Dichte der \xdcberschussladungstr\xe4ger p'=n' \xfcber dem Ort x auf, so ergibt sich eine abklingende Exponentialfunktion mit der Abklingkonstanten Lp, der so genannten Diffusionsl\xe4nge, welche proportional zu der Lebensdauer der Minorit\xe4tstr\xe4ger ist. Die Diffusionsl\xe4nge Lp kann demnach als die von den Ladungstr\xe4gern w\xe4hrend der Lebensdauer im Mittel zur\xfcckgelegten Strecke interpretiert werden.","Eine \xc4nderung der Minorit\xe4tstragerlebensdauer bzw. der Diffusionsl\xe4nge f\xfchrt zu einer \xc4nderung der Verteilung der Ladungstr\xe4ger und damit auch zu einer \xc4nderung der in dem Halbleiter gespeicherten Ladungsmenge."]),t.s)
B.Ai=new A.c0("Ebenso wie nach einer tempor\xe4ren St\xf6rung des thermodynamischen Gleichgewichtes (z.B. durch Lichteinstrahlung) strebt der Halbleiter auch bei einer lokalen St\xf6rung stets wieder den Gleichgewichtszustand an.\n\nDas folgende Applet zeigt das Verhalten einer n-Typ Halbleiterprobe bei einer lokalen St\xf6rung des TGGs durch st\xe4ndige Injektion von Elektronen und L\xf6chern am linken Rand (x=0) der Probe. Der Anschaulichkeit halber werden in dem Halbleiter nur die durch Injektion zus\xe4tzlich vorhandenen Ladungstr\xe4ger (n' bzw. p') dargestellt.\n\nMan sieht:\n",B.Km,"Englisch",B.a2,null)
B.Jn=A.a(s(["Aus der \xdcbertragungskennlinie des Verst\xe4rkers erkennt man, dass ein Eingangssignal UBE nur im mittleren Bereich der Kennlinie verst\xe4rkt wird, in dem die Steigung dUCE/dUBE gro\xdf ist.","Um ein sinusf\xf6rmiges Eingangssignal mit der Amplitude ube verzerrungsfrei zu verst\xe4rken, muss diesem demnach ein Gleichanteil UBE0 \xfcberlagert werden, so dass das Eingangssignal stets im mittleren Bereich der Kennlinie verl\xe4uft. Der Gleichanteil UBE0 legt dabei den so genannten Arbeitspunkt der Verst\xe4rkerschaltung fest.","Liegt der Arbeitspunkt in der Mitte der Kennlinie, kann die Amplitude ube des Eingangssignals sehr gro\xdf gew\xe4hlt werden, ohne dass Begrenzungseffekte und damit Verzerrungen auftreten. Diese Betriebsart nennt man A-Betrieb.","Liegt der Arbeitspunkt auf dem Wert UBE0=0V, so spricht man vom B-Betrieb. Bei dieser Betriebsart wird die untere Halbwelle des Eingangssignals vollst\xe4ndig und die obere zum Teil abgeschnitten, das Signal also stark verzerrt.","Beim so genannten AB-Betrieb liegt der Arbeitspunkt UBE0 etwa im Knickpunkt der Kennlinie bei relativ kleinen Spannungen UBE0. Die untere Halbwelle des Eingangssignals wird zwar abgeschnitten, die obere Halbwelle des Eingangssignals wird jedoch bis hin zu sehr gro\xdfen Amplituden verzerrungsfrei \xfcbertragen.","Der C-Betrieb ist durch eine negative Vorspannung UBE0<0 gekennzeichnet. Diese Betriebsart wird z.B. bei Sender\xf6hren angewandt."]),t.s)
B.Aj=new A.c0(u.f,B.Jn,"Englisch",B.a2,null)
B.IO=A.a(s(["Bei undotierten Halbleitern liegt das Ferminiveau etwa in der Mitte des verbotenen Bandes.","Dotiert man den Halbleiter mit Donatoren (Erh\xf6hung von ND), so wandert der Schnittpunkt der beiden Kurven zur Leitungsbandkante Wc. Bei einer Dotierung mit Akzeptoren wandert das Ferminiveau entsprechend zur Valenzbandkante Wv.","Wird der Halbleiter sowohl mit Donatoren als auch mit Akzeptoren dotiert, so wird das Verhalten des Halbleiters (n- oder p-Typ) allein durch die Dotieratome mit der h\xf6heren Konzentration bestimmt.","Da f\xfcr einen undotierten Halbleiter die Tr\xe4gerdichten n0 und p0 gleich der Eigenleitungstr\xe4gerdichte ni sind und das Ferminiveau WF gleich dem Eigenleitungsniveau Wi ist, folgen unmittelbar die wichtigen Beziehungen:"]),t.s)
B.Ak=new A.Gq(null)
B.Kk=A.a(s(["Liegt das Ferminiveau in der Mitte zwischen Valenz- und Leitungsbandkante (undotierter Halbleiter), so sind die Kurven nw und pw symmetrisch zu Wf. Insbesondere sind die Fl\xe4chen unter den beiden Kurven und damit die Anzahl der freien Ladungstr\xe4ger n0 und p0 gleich gro\xdf.","Eine Erh\xf6hung der Temperatur f\xfchrt wegen des sich \xe4ndernden Verlaufes der Fermiverteilung zu einer Erh\xf6hung beider Tr\xe4gerdichten.","Bei einem n-dotierten Halbleiter, bei dem das Ferminiveau Wf und damit die gesamte Kurve F(W) nach oben verschoben ist, ergibt die Multiplikation und anschlie\xdfende Integration der Kurven einen h\xf6heren Wert f\xfcr die Elektronendichte n0 und einen kleineren Wert f\xfcr die L\xf6cherdichte p0. Umgekehrtes gilt f\xfcr einem p-Typ Halbleiter. Die Lage des Ferminiveaus Wf bestimmt also unmittelbar die Tr\xe4gerdichten im thermodynamischen Gleichgewicht."]),t.s)
B.Al=new A.Gr(null)
B.HV=A.a(s(["Liegt ein Elektron energiem\xe4\xdfig oberhalb der Bandkante Wc, so besitzt es zus\xe4tzliche kinetische Energie und damit einen Impuls i. Die Impulsvektoren aller Teilchen mit einer Energie zwischen W und W+dW haben demnach einen Impuls zwischen i und i+di, so dass die Impulsvektoren auf einer Kugelschale mit dem Radius i und der Dicke di liegen.","Die Zahl der voneinander unterscheidbaren Impulsvektoren auf der Kugelschale ist jedoch begrenzt, da der Impuls nach der Heisenbergschen Unsch\xe4rferelation eine gewisse Unsch\xe4rfe hat, wenn der Ort des Teilchens genau bestimmt ist. Die Impulsvektoren m\xfcssen also einen bestimmten Mindestabstand voneinander haben.","Erh\xf6ht man nun die Energie W und damit den Impuls i, entspricht das einer Vergr\xf6\xdferung der Kugelschale, so dass nun mehr Impulsvektoren Platz finden; die Zustandsdichte nimmt zu."]),t.s)
B.Am=new A.c0("Dieses Applet veranschaulicht den Begriff der Zustandsdichte.\n\nMan sieht:\n",B.HV,"Englisch",B.a2,null)
B.J_=A.a(s(["W\xe4hlt man UBE=0V, so liegen die Ferminiveaus Wf in Emitter und Basis auf gleicher H\xf6he. Wegen UCE=+1V liegt das Ferminiveau im Kollektor gem\xe4\xdf W = -q\xb7U unterhalb der Ferminiveaus in Emitter und Basis. Aufgrund der unterschiedlichen Dotierungen von Emitter und Basis liegen die Bandkanten Wv und Wc in diesen Bereichen relativ zum Ferminiveau auf unterschiedlicher H\xf6he. Dadurch ergibt sich eine Potenzialbarriere, die die Elektronen \xfcberwinden m\xfcssen, wenn sie sich von dem n-dotierten Emitter in den n-dotierten Kollektor bewegen.","Erh\xf6ht man nun die Basis-Emitter-Spannung UBE, so verringert sich die Potenzialbarriere zwischen Emitter und Basis. Elektronen, die im Emitter als Majorit\xe4tstr\xe4ger zahlreich zur Verf\xfcgung stehen, k\xf6nnen jetzt ungehindert vom Emitter \xfcber die Basis in den Kollektor gelangen. Es flie\xdft ein Strom."]),t.s)
B.An=new A.c0("Das folgende Applet zeigt die Funktionsweise des Bipolartransistors schematisch anhand des B\xe4nderdiagramms.\n\nMan sieht:\n",B.J_,"Englisch",B.a2,null)
B.HT=A.a(s(["Der Wert der Raumladungsdichte wird durch die Dotierung in dem entsprechenden Gebiet bestimmt, also durch ND im n-Gebiet und durch NA im p-Gebiet.","Aus Neutralit\xe4tsgr\xfcnden m\xfcssen sich die Ladungen im p- und n-Gebiet gegenseitig kompensieren, d.h. die Fl\xe4chen unter den Rechtecken m\xfcssen gleich gro\xdf sein.","Daraus folgt, dass sich die Raumladungszone um so weiter in den Halbleiter erstreckt, je geringer die Dotierung ist. Gleichzeitig wird die Raumladung und damit das elektrische Feld kleiner."]),t.s)
B.Ao=new A.c0("Dieses Applet zeigt, wie sich die Raumladungszone eines pn-\xdcberganges mit den Dotierungsdichten NA und ND des p- und des n-Gebietes \xe4ndert.\n\nMan sieht:\n",B.HT,"Englisch",B.a2,null)
B.IG=A.a(s(["Eine Erh\xf6hung des Stromes IB0 am Eingang f\xfchrt zun\xe4chst zu einem Anstieg des Stromes IC im Ausgangskreis. Gleichzeitig verringert sich die Spannung UCE am Ausgang, da der Spannungsabfall \xfcber Rc gr\xf6\xdfer wird.","Erh\xf6ht man das Eingangssignal immer weiter, wird die Spannung UCE am Ausgang sehr klein, so dass die Basis-Kollektor Diode schlie\xdflich in Durchlassrichtung geschaltet wird und der Transistor in S\xe4ttigung geht. Dadurch verringert sich die Stromverst\xe4rkung B. Der Strom IC steigt dann trotz weiterer Zunahme von IB0 nicht mehr weiter an.","Wird der Eingang des Verst\xe4rkers mit einem Sinussignal angesteuert (AC on), so muss ein geeigneter Eingangsruhestrom IB0 eingestellt werden, damit das Sinussignal vollst\xe4ndig \xfcbertragen wird."]),t.s)
B.Aq=new A.c0("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit Bipolartransistor.\n\nMan sieht:\n",B.IG,"Englisch",B.a2,null)
B.IF=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T3 und T4 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T2.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes durch die beiden Transistoren T2 und T4 sowie den Wert der Ausgangsspannung Ua. Die Ausgangsspannung im Arbeitspunkt kann bei der Schaltung z.B. auf den Wert Ua,A = 0V eingestellt werden.","Wegen des flachen Verlaufs der Kennlinien haben bereits kleine \xc4nderungen der Eingangsspannung Ue gro\xdfe Auswirkungen auf die Lage des Schnittpunktes der beiden Kurven und damit auf die Spannung Ua am Ausgang der Schaltung. Die Verst\xe4rkung dieser Schaltung f\xfcr Differenzeingangssignale ist daher sehr gro\xdf.","Da die Verst\xe4rkung um so gr\xf6\xdfer ist, je flacher die Steigung der Kennlinien ist, steigt die Verst\xe4rkung mit zunehmendem Ausgangswiderstand r0, d.h. mit abnehmendem Kanall\xe4ngenmodulationsfaktor Lambda der Transistoren."]),t.s)
B.Ar=new A.c0("Dieses Applet veranschaulicht die Funktion des Differenzverst\xe4rkers mit Stromspiegel bei Ansteuerung mit Differenzsignalen.\n\nMan sieht:\n",B.IF,"Englisch",B.a2,null)
B.KE=A.a(s(["Bei Upn=0 flie\xdft kein Strom durch die Diode, da sich die durch den Konzentrationsgradienten hervorgerufene Diffusionsbewegung und die durch das elektrische Feld in der Raumladungszone verursachte Driftbewegung der Ladungstr\xe4ger gerade aufheben.","Bei einer Spannung Upn>0 verringert sich das elektrische Feld in der Raumladungszone, so dass die Diffusion \xfcberwiegt. Dadurch diffundieren die Majorit\xe4tstr\xe4ger durch die Raumladungszone hindurch in das jeweils andere Gebiet wo sie schlie\xdflich mit den dortigen Majorit\xe4tstr\xe4gern rekombinieren. Letztere m\xfcssen daher st\xe4ndig aus den neutralen Gebieten nachgeliefert werden, so dass ein Strom I durch die Diode flie\xdft.","Mit zunehmender Spannung Upn dominiert die Diffusion immer mehr, so dass auch der Strom I immer gr\xf6\xdfer wird.","Wird die Diode in Sperrrichtung gepolt, dominiert wegen des gr\xf6\xdfer werdenden elektrischen Feldes der Driftstrom. Dieser f\xfchrt dazu, dass sich Minorit\xe4tstr\xe4ger durch die Raumladungszone bewegen. Wegen der sehr geringen Dichte der Minorit\xe4tstr\xe4ger ist der Strom jedoch sehr klein."]),t.s)
B.As=new A.c0("Dieses Applet veranschaulicht die Funktion einer pn-Diode.\n\nMan sieht:\n",B.KE,"Englisch",B.a2,null)
B.JD=A.a(s(["Liegt das Ferminiveau WF in der Mitte zwischen den beiden Bandkanten auf dem Intrinsicniveau Wi, so sind die Elektronendichte und die L\xf6cherdichte gleich der Intrinsicdichte ni.","Eine Verschiebung des Ferminiveaus zur Leitungsbandkante (was einem n-Typ Halbleiter entspricht) f\xfchrt zu einem Anstieg der Elektronendichte n0 und einer Abnahme der L\xf6cherdichte p0.","Bei einem p-Typ Halbleiter, bei dem das Ferminiveau zur Valenzbandkante verschoben ist, ist dagegen die L\xf6cherdichte erh\xf6ht und die Elektronendichte vermindert.","In allen F\xe4llen gilt, dass (im thermodynamischen Gleichgewicht) das Produkt aus Elektronendichte und L\xf6cherdichte gleich ni^2 ist (Massenwirkungsgesetz), was sich in der logarithmischen Darstellung deutlich zeigt."]),t.s)
B.At=new A.Gs(null)
B.KO=A.a(s(["Im Bode-Diagramm ist der typische Frequenzgang |a(jw)| und der Phasengang Phase[a(jw)] eines nicht r\xfcckgekoppelten Verst\xe4rkers a mit abnehmender Verst\xe4rkung f\xfcr hohe Frequenzen dargestellt, wie er sich z.B. f\xfcr einen Operationsverst\xe4rker ergibt.","Zus\xe4tzlich ist in das Diagramm der Kehrwert 1/k des - hier frequenzunabh\xe4ngigen - R\xfcckkopplungsfaktors eingetragen, was einem R\xfcckkopplungsnetzwerk mit ohmschen Widerst\xe4nden entspricht.","F\xfcr die Gesamtverst\xe4rkung des r\xfcckgekoppelten Systems gilt A = a/(1+ak). Da f\xfcr gro\xdfe Werte von a n\xe4herungsweise A=1/k gilt, kann man A direkt aus dem Diagramm ablesen. F\xfcr gr\xf6\xdfer werdendes k, d.h. st\xe4rkere R\xfcckkopplung, sieht man deutlich die Abnahme der Gesamtverst\xe4rkung.","Die f\xfcr die Stabilit\xe4t wichtige Schleifenverst\xe4rkung a*k ergibt sich in der logarithmischen Darstellung wegen a*k=a/(1/k) aus dem Abstand der Kurve a zur Kurve 1/k und kann ebenfalls direkt abgelesen werden.","Insbesondere ist am Schnittpunkt der Kurven a und 1/k der Betrag |a*k| der Schleifenverst\xe4rkung gleich 1 (=0dB). Ist nun bei dieser Frequenz wd die Phase gleichzeitig 180 Grad, so ist a*k = -1, d.h. der Verst\xe4rker ist instabil und schwingt.","F\xfcr kleine R\xfcckkopplungsfaktoren k ist bei der Frequenz wd die Phase sehr weit von dem kritischen Wert 180 Grad entfernt, der Verst\xe4rker ist stabil.","F\xfcr zunehmendes k, d.h. st\xe4rkere R\xfcckkopplung, r\xfcckt die Phase bei der Frequenz wd, wo der Betrag der Schleifenverst\xe4rkung gleich 1 ist, immer n\xe4her an 180 Grad, der Verst\xe4rker wird instabil und schwingt.","Um Stabilit\xe4t des r\xfcckgekoppelten Verst\xe4rkers f\xfcr beliebiges k zu gew\xe4hrleisten, greift man zur so genannten Kompensation. Dabei wird der Frequenz- und Phasengang des nicht r\xfcckgekoppelten Verst\xe4rkers durch schaltungstechnische Ma\xdfnahmen so ge\xe4ndert, dass die Phase an der Stelle wd f\xfcr beliebige k 180 Grad nicht erreicht."]),t.s)
B.Au=new A.c0("Dieses Applet zeigt den Zusammenhang zwischen der Schleifenverst\xe4rkung eines gegengekoppelten Verst\xe4rkers und dessen Stabilit\xe4t.\n\nMan sieht:\n",B.KO,"Englisch",B.a2,null)
B.Jv=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.s)
B.Av=new A.c0("Dieses Applet zeigt die Konstruktion der \xdcbertragungskennlinie UCE=UCE(UBE) eines einfachen Verst\xe4rkers sowie den Einfluss wichtiger Schaltungsparameter (UB, R) auf die Verst\xe4rkung.\n\nMan sieht:\n",B.Jv,"Englisch",B.a2,null)
B.IC=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.","Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.s)
B.Aw=new A.c0("Dieses Applet veranschaulicht die Funktion eines Stromspiegels mit pnp-Transistoren.\n\nMan sieht:\n",B.IC,"Englisch",B.a2,null)
B.KV=A.a(s(["Durch die unterschiedlichen Lagen der Bandkanten Wv und Wc relativ zum Ferminiveau bei unterschiedlichen Dotierungen (vgl.: Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm), stellt das Bulk-Gebiet (p-dotiert) eine Potenzialbarriere dar, die Elektronen \xfcberwinden m\xfcssen, wenn sie sich von der n-dotierten Source zu der n-dotierten Drain bewegen.","Erh\xf6ht man bei UGS=0 das Potenzial an der Drain-Elektrode (UDS>0), verschieben sich dort das Ferminiveau und demzufolge auch die Bandkanten Wc und Wv entsprechend nach unten, die Elektronen k\xf6nnen aber die nach wie vor existierende Potentialbarriere zwischen Source und Drain nicht \xfcberwinden, so dass kein Strom flie\xdft.","Erh\xf6ht man das Potenzial an der Gate-Elektrode, bleibt das Ferminiveau im Bulk zwar auf unver\xe4ndertem Niveau, die Bandkanten Wc und Wv verschieben sich jedoch im Bereich des Gates relativ zum Ferminiveau nach unten (siehe auch: B\xe4nderdiagramm einer MOS-Struktur) und die Potenzialbarriere zwischen Source und Drain verringert sich. Bei hinreichend gro\xdfer Gatespannung (UGS>Uth) kann demnach ein Strom zwischen Source und Drain flie\xdfen, sofern eine Spannung UDS anliegt.","Ein Erh\xf6hen des Bulk-Potenzials (USB<0) verschiebt hingegen das Ferminiveau im Bereich des Bulks nach oben und damit auch die Potenzialbarriere. Unter sonst gleichen Bedingungen muss also jetzt eine h\xf6here Gatespannung UGS angelegt werden, um einen Stromfluss zwischen Source und Drain zu erhalten. Diesen Effekt bezeichnet man auch als Substratsteuereffekt."]),t.s)
B.Ax=new A.c0("Das folgende Applet stellt die Funktionsweise des MOSFET mit Hilfe des B\xe4nderdiagramms dar. Gate-, Drain- und Bulk-Potenzial k\xf6nnen dabei jeweils gegen\xfcber dem Source-Potenzial (Bezugspotenzial) ge\xe4ndert werden.\n\nMan sieht:\n",B.KV,"Englisch",B.a2,null)
B.J4=A.a(s(["Vor dem Zusammenf\xfchren der beiden Halbleiter sind diese elektrisch neutral, da jedem freien Elektron (-) im n-Gebiet ein ortsfestes, positiv ionisiertes Donatoratom ND+ (nicht eingezeichnet) gegen\xfcbersteht. Umgekehrt wird die L\xf6cherladung im p-Typ Halbleiter von den ionisierten Akzeptoratomen NA- kompensiert.","Nach dem Zusammenf\xfchren entsteht wegen der gro\xdfen Konzentrationsgradienten an dem \xdcbergang zun\xe4chst eine Diffusionsbewegung der Ladungstr\xe4ger, d.h. L\xf6cher (+) diffundieren vom p-Gebiet in das n-Gebiet und Elektronen (-) vom n-Gebiet in das p-Gebiet. Dadurch entsteht jedoch ein Ladungsungleichgewicht und somit ein elektrisches Feld E, welches seinerseits eine Driftbewegung hervorruft, die der Diffusionsbewegung entgegengerichtet ist.","Nach kurzer Zeit stellt sich ein Gleichgewicht zwischen dem Diffusionsvorgang und der Driftbewegung ein."]),t.s)
B.Ay=new A.Gt(null)
B.JB=A.a(s(["Wird von au\xdfen eine elektrische Spannung Upn>0 an die Diode angelegt, so verringert sich die effektive, \xfcber dem pn-\xdcbergang liegende Spannung und damit auch das elektrische Feld E. Als Folge davon \xfcberwiegt nun die Diffusionsbewegung; Elektronen werden verst\xe4rkt ins p-Gebiet und L\xf6cher verst\xe4rkt in das n-Gebiet injiziert. Wegen der Neutralit\xe4t au\xdferhalb der RLZ m\xfcssen im gleichen Ma\xdfe die Majorit\xe4tstr\xe4gerdichten (L\xf6cher im p-Halbleiter, Elektronen im n-Halbleiter) ansteigen, so dass beide Ladungstr\xe4gerarten au\xdferhalb der RLZ oberhalb ihrer Gleichgewichtsdichten liegen. Dies f\xfchrt zur Rekombination der Ladungstr\xe4ger. So rekombinieren z.B. die in das p-Gebiet injizierten Elektronen mit den dort befindlichen L\xf6chern. Es m\xfcssen daher st\xe4ndig Majorit\xe4tstr\xe4ger aus den neutralen Gebieten nachgeliefert werden, was einem elektrischen Strom entspricht. Der Strom ist um so gr\xf6\xdfer, je mehr Ladungstr\xe4ger in die neutralen Gebiete injiziert werden, d.h. je h\xf6her die Konzentration der Ladungstr\xe4ger an den R\xe4ndern Xp und Xn der RLZ ist. Diese Konzentration h\xe4ngt exponentiell von der Spannung am pn-\xdcbergang und damit von der von au\xdfen angelegten Spannung Upn ab. Der Strom I durch die Diode steigt daher exponentiell mit der Spannung Upn, was sich in der steil ansteigenden I-U-Kennlinie f\xfcr U>0 zeigt.","F\xfcr Spannungen Upn < 0 wird die effektive Spannung und damit die Feldst\xe4rke E am pn-\xdcbergang erh\xf6ht. Dadurch \xfcberwiegt nun die Driftbewegung gegen\xfcber dem Diffusionsvorgang und die Ladungstr\xe4gerdichten an den Stellen Xn und Xp sinken auf sehr kleine Werte ab. Es gelangen somit auch nur noch sehr wenige Ladungstr\xe4ger durch die RLZ in das jeweils benachbarte Gebiet. Diese wenigen Ladungstr\xe4ger liefern den so genannten Sperrstrom, der sehr klein ist und der auch f\xfcr gro\xdfe negative Spannungen kaum noch w\xe4chst. Die I-U-Kennlinie zeigt daher f\xfcr negative Spannungen kaum noch eine \xc4nderung des Stromes I.","Da sich mit der von au\xdfen angelegten Spannung Upn auch die Spannung am pn-\xdcbergang - d.h. \xfcber der RLZ - \xe4ndert, ver\xe4ndert sich damit auch die Weite der gesamten Raumladungszone. Insbesondere w\xe4chst diese, wenn die Sperrspannung Upn < 0 weiter zu negativen Werten hin erh\xf6ht wird. Die Spannung \xfcber der RLZ - die der Fl\xe4che unter dem Dreieck E(X) entspricht - ist dabei gleich der Diffusionsspannung abz\xfcglich der Spannung Upn."]),t.s)
B.Az=new A.c0("Dieses Applet veranschaulicht die Funktionsweise der Diode, indem eine Spannung Upn von au\xdfen an einen pn-\xdcbergang gelegt wird. Nach Vorgabe der Spannung Upn wird der Strom I durch die Diode berechnet. Dar\xfcber hinaus werden die Verteilungen der Ladungstr\xe4ger (Elektronen und L\xf6cher) im p- und n-Gebiet sowie das elektrische Feld E bestimmt und grafisch dargestellt.\n\nMan sieht:\n",B.JB,"Englisch",B.a2,null)
B.KC=A.a(s(["Werden Metall und Halbleiter in Kontakt gebracht, so muss im thermodynamischen Gleichgewicht das Ferminiveau Wf in beiden Materialien auf einer H\xf6he verlaufen. Entsprechend m\xfcssen daher die beiden B\xe4nderdiagramme vertikal gegeneinander verschoben werden, was zu einer Verbiegung der B\xe4nder im Bereich des \xdcbergangs f\xfchrt.","Fall 1: Schottky-Kontakt\nBei einem n-Typ-Halbleiter ergibt sich durch die Verbiegung der B\xe4nder eine Spitze in der Leitungsbandkante Wc, die f\xfcr Elektronen eine Potentialbarriere darstellt, welche nicht ohne Weiteres \xfcberwunden werden kann. Bei einem p-Typ-Halbleiter hingegen ergibt sich eine Potentialbarriere in der Valenzbandkante Wv, die von L\xf6chern nicht ohne Weiteres \xfcberwunden werden kann.","Fall 2: Ohmscher Kontakt\nDie Bandverbiegung im Bereich des \xdcbergangs f\xfchrt nicht zu einer Potentialbarriere, d.h. die Ladungstr\xe4ger k\xf6nnen ungehindert von einem Gebiet in das andere gelangen; der Strom wird nur durch den ohmschen Widerstand der neutralen Bahngebiete bestimmt."]),t.s)
B.AA=new A.c0('In diesem Applet wird die Konstruktion des B\xe4nderdiagramms eines Metall-Halbleiter-Kontaktes animiert dargestellt. Dabei kann ausgew\xe4hlt werden, ob der entstehende Kontakt ein dioden\xe4hnliches Verhalten (Schottky) oder aber ein ohmsches Verhalten (ohmic) aufweisen soll. Weiterhin kann die Dotierung des Halbleiters (n-type oder p-type) festgelegt werden. Bei einem n-Halbleiter werden die Eigenschaften des Kontaktes durch das Verhalten der Elektronen bestimmt, die sich entlang der Leitungsbandkante Wc bewegen. Bei einem p-Halbleiter hingegen bestimmen die sich entlang der Valenzbandkante Wv bewegenden L\xf6cher die Eigenschaften des Kontaktes. Zun\xe4chst werden die B\xe4nderdiagramme f\xfcr das Metall und f\xfcr den Halbleiter getrennt dargestellt. Das Vakuumniveau Wo dient dabei als gemeinsames Bezugsniveau. Nach Bet\xe4tigung der Schaltfl\xe4che "Start" werden die beiden Materialien miteinander in Kontakt gebracht. Im oberen Panel des Applets werden die Verl\xe4ufe der Energieb\xe4nder dargestellt. Das untere Panel zeigt die zugeh\xf6rige Verteilung der Ladungsdichte .\n\nMan sieht:\n',B.KC,"Englisch",B.a2,null)
B.KS=A.a(s(["Bei der Spannung UGB=0V liegen die Ferminiveaus des Metalls und des Halbleiters auf gleicher H\xf6he. Die B\xe4nder verlaufen horizontal.","Bei negativen Spannungen (UGB<0V) verschieben sich die Ferminiveaus gem\xe4\xdf U=-W/q und es tritt eine Verbiegung der B\xe4nder sowohl im Isolator als auch im Halbleiter auf. Der gr\xf6\xdfer werdende Abstand zwischen Ferminiveau Wf und Intrinsicniveau Wi entspricht einer Zunahme der L\xf6cherdichte und einer Abnahme der Elektronendichte in der N\xe4he der Grenzfl\xe4che Oxid-Halbleiter (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus). Diesen Fall der Anh\xe4ufung von Majorit\xe4tstr\xe4gern an der Grenzfl\xe4che Oxid-Halbleiter nennt man Akkumulation.","Bei kleinen positiven Spannungen (UGB>0V) verbiegen sich die B\xe4nder entsprechend in die andere Richtung, so dass nun eine Abnahme der L\xf6cherdichte und eine Zunahme der Elektronendichte in der N\xe4he der Grenzfl\xe4che Oxid-Halbleiter auftritt. Durch das Ausr\xe4umen der L\xf6cher entsteht eine Raumladungszone in dem Bereich 0<x<xd. Diesen Fall nennt man Verarmung.","Ab einer bestimmten positiven Spannung (hier: UGB=0,8V) ist die Elektronendichte an der Grenzfl\xe4che so gro\xdf wie die L\xf6cherdichte des p-Halbleiters sehr weit von der Grenzfl\xe4che entfernt. Diesen Zustand des Halbleiters nennt man Inversion. Die Spannung, bei der die Inversion einsetzt, ist die so genannte Einsatzspannung.","F\xfcr noch gr\xf6\xdfere Spannungen oberhalb der Einsatzspannung (hier: UGB>0,8V) nimmt die Elektronendichte an der Grenzschicht Oxid-Halbleiter immer weiter zu, die B\xe4nder des Halbleiters verbiegen sich wegen der exponentiellen Abh\xe4ngigkeit zwischen Spannung und Ladungstr\xe4gerdichte aber kaum noch. Das hei\xdft, dass auch die Weite xd der Raumladungszone von nun ab n\xe4herungsweise konstant bleibt."]),t.s)
B.AB=new A.c0("Dieses Applet verdeutlicht die physikalischen Vorg\xe4nge in der MOS-Struktur nochmals anhand einer vereinfachten B\xe4nderdiagrammdarstellung. Gezeigt wird das Verhalten einer MOS-Struktur abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.KS,"Englisch",B.a2,null)
B.JF=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.s)
B.AC=new A.c0("Das Applet zeigt die Auswirkungen auf die m\xf6glichen Energiezust\xe4nde W zweier einzelner Atome, wenn diese miteinander in Wechselwirkung gebracht werden, indem man den Abstand zwischen ihnen verringert.\n\nMan sieht:\n",B.JF,"Englisch",B.a2,null)
B.IK=A.a(s(["F\xfcr UBE=0V und UCE=5V ist sowohl der Basis-Kollektor \xdcbergang als auch der Basis-Emitter \xdcbergang in Sperrrichtung gepolt, so dass kein Strom durch den Transistor flie\xdft, d.h. IE=IC=0.","Erh\xf6ht man die Basis-Emitter Spannung auf etwa UBE=0,7V, so wird der Basis-Emitter \xdcbergang in Durchlassrichtung gepolt. Dies f\xfchrt (vgl. Diode) zum einen dazu, dass L\xf6cher vom p-Gebiet (der Basis) in das n-Gebiet (den Emitter) diffundieren und dort rekombinieren. Zum anderen diffundieren Elektronen umgekehrt von dem n-Gebiet in die Basis. Da die Basisweite jedoch sehr klein ist, rekombinieren die Elektronen dort nicht, sondern gelangen bis in den n-dotierten Kollektor. Die angelegte Basis-Emitter Spannung f\xfchrt somit zu einem Elektronenstrom vom Emitter durch das Basisgebiet bis hin zum Kollektor."]),t.s)
B.AD=new A.c0("Dieses Applet veranschaulicht die Funktion des Bipolartransistors.\n\nMan sieht:\n",B.IK,"Englisch",B.a2,null)
B.IJ=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Phosphor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (f\xfcnfwertige) P-Atome, so gehen jeweils vier der f\xfcnf Elektronen des Phosphor-Atoms (P) eine Bindung mit den benachbarten Si-Atomen ein; das f\xfcnfte Elektron bleibt jedoch ungebunden.",'Dieses f\xfcnfte Elektron, das keine Bindung eingegangen ist, kann bereits durch Zuf\xfchren geringer Ionisierungsenergie (z.B. geringe Temperaturerh\xf6hung) von dem Phosphor-Atom (P), dem so genannten Donator, gel\xf6st werden und wird dann zu einem "freien" Elektron. In dem B\xe4nderdiagramm entspricht diese geringe Ionisierungsenergie dem geringen Abstand des Donatorniveaus Wd zum Leitungsband Wc.',"Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (150K) alle Phosphoratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien Elektronen no gleich der Dichte ND der Dotierungsatome ist.","Der positive Atomrumpf (P+) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Durch das Dotieren erh\xf6ht sich demnach nur die Anzahl der freien Elektronen, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Wird die Temperatur weiter erh\xf6ht (T>300K) l\xf6sen sich - wie auch beim undotierten Halbleiter - immer mehr Bindungen zwischen den Si-Atomen und es entstehen zus\xe4tzliche Elektronen-Loch-Paare.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes, ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Phosphor dotierten Halbleiter die freien Elektronen ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem n-Typ Halbleiter."]),t.s)
B.AE=new A.c0("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Phosphor) die Anzahl der zum Stromtransport wichtigen freien Elektronen erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.IJ,"Englisch",B.a2,null)
